(global["webpackJsonp"]=global["webpackJsonp"]||[]).push([["components/index/protocolDetails"],{"3f5f":function(n,r,b){"use strict";(function(n,r){var t=b("4ea4");b("e25e");t(b("66fd"));var e=t(b("c033"));n.__webpack_require_UNI_MP_PLUGIN__=b,r(e.default)}).call(this,b("bc2e")["default"],b("543d")["createPage"])},"41a0":function(n,r,b){},53358:function(n,r,b){"use strict";b.d(r,"b",(function(){return e})),b.d(r,"c",(function(){return u})),b.d(r,"a",(function(){return t}));var t={uParse:function(){return Promise.all([b.e("common/vendor"),b.e("uni_modules/uview-ui/components/u-parse/u-parse")]).then(b.bind(null,"0bbe"))}},e=function(){var n=this.$createElement;this._self._c},u=[]},aeea:function(n,r,b){"use strict";b.r(r);var t=b("fc10"),e=b.n(t);for(var u in t)["default"].indexOf(u)<0&&function(n){b.d(r,n,(function(){return t[n]}))}(u);r["default"]=e.a},c033:function(n,r,b){"use strict";b.r(r);var t=b("53358"),e=b("aeea");for(var u in e)["default"].indexOf(u)<0&&function(n){b.d(r,n,(function(){return e[n]}))}(u);b("ff09");var c=b("f0c5"),a=Object(c["a"])(e["default"],t["b"],t["c"],!1,null,null,null,!1,t["a"],void 0);r["default"]=a.exports},fc10:function(n,r,b){"use strict";Object.defineProperty(r,"__esModule",{value:!0}),r.default=void 0;r.default={data:function(){return{content:'\n\t\t\t\t\t\t\t\t\t<p class="proTitle">用户服务及隐私协议</p>\n\t\t\t\t\t\t\t\t\t<div>欢迎您注册并使用职者云账户及服务。\n职者云一直以来视用户的信息安全与隐私保护为公司的生命线。我们已根据现行法律法规制定了《职者云用户服务及隐私政策》，并且采取相应的安全保护措施来保护您的个人信息，对于重点内容，我们也已在协议中进行重点标注。请您仔细阅读。</br>\n温馨提示您注意：当您点击“同意”时，视为您已阅读并愿意接受《职者云用户服务及隐私政策》的所有内容，当您点击“不同意”时，我们将无法为您提供完整的产品和服务。</br>\n一、本用户协议适用于职者云云平台、移动客户端等各关联平台或媒介的服务。</br>\n二、由于您的账号关联您的个人信息及平台商业信息，您的账号仅限本人使用。为保护您的权益与个人信息，您不得出借、出租、转让账号，或者直接或间接授权任何第三方使用您账号或获取您账号信息。</br>\n三、账号注册与使用</br>\n1、职者云旨在搭建人才与雇主之间的信用档案库，为帮助您匹配更优质单位和职位，您应当秉承积极向上、诚实信用的原则，合法、真实、准确地填写您的信息，并不隐瞒与就业有关的重要信息。系统将为您的每段实录信息保留90天时间以供完善，期间可修改，期满将纳入您的职场实录信息，无法修改。请相信，实录信息也为雇主单位更全面、真实了解您的就职能力水平提供了有力说明。有您助力，我们共建风清气正的招聘就业环境，推动实现学有所用。如果您所提供信息不合法、不真实、不准确或未及时更新，将有可能给您带来不利后果或相关法律责任。\n同时，平台也将严格要求用人单位填报相关资质（营业期限、社保福利保障、过往信用记录），我们进行严格审核，为求职者做好把关。</br>\n2、您应该承诺在注册时已年满18周岁，且具备相应的民事行为能力签订本用户协议。如存在不当注册或不当使用职者云账号的情形，我们可能对相关账号进行一定程度的限制使用、登录或采取其他合理措施（如暂时或永久封禁账号等）。</br>\n3、请妥善管理您的用户名、登录密码、支付密码（如有），请不要轻信索要密码或财产的网络信息，不要将上述信息提供给任何第三方使用，不从事任何可能使用户名、 密码存在泄露危险的行为。为保障您良好的职场记录，请务必对您账号下的所有行为结果（包括但不限于浏览招聘信息、购买商品服务及披露信息等）负责。</br>\n四、职者云服务及规范</br>\n1、服务概况</br>\n职者云致力于打造“可溯源”人力资源供需双方闭环体系，是一个对接高社会值产业资源，构建人才、智果培育与供需数智化综合解决平台。职者云向用户提供的服务，包括且不限于求职招聘、创业孵化、职前教育等产品和服务。平台会根据用户的需求不定期调整更新，具体请以云平台的展示服务项目为准。</br>\n2、招聘服务</br>\n职者云用于人才求职、招聘、创业项目发布，不应从事影响我们提供服务或损害他人合法利益的行为，包括且不限于：</br>\n1)公布非简历资料，如商业广告、通知、意见等；</br>\n2)除授权的发布者外，删除或修改其他个人或公司发布的资料；</br>\n3)将我们的产品或服务用于非法目的；</br>\n4)违反中华人民共和国法律法规和互联网用户规范等。</br>\n3、反馈服务</br>\n您可通过“工作收获”、“自我评价”等功能对您曾任职或现在任职的单位做出评价，也可通过“企业反馈”功能获取雇主单位对您的反馈内容，通过平台功能保存双方反馈内容，以共同推动职场环境的良好向善发展。</br>\n4、智能服务</br>\n您理解并同意职者云平台通过智能匹配技术，为您更全面、更精准的匹配岗位服务或有关招聘、创业活动的专场活动信息，以更高效提升信息对接效率。限于互联网技术及人力的局限性，平台无法完全保证向您推送的信息均适配、完整、可靠，特别提醒您应审慎判断抉择。</br>\n5、社区服务</br>\n您可通过社区功能分享、传播及获取职场信息，如您使用社区服务，应遵守社区交流规范，对所发表的内容真实性和合法性负责并承担法律责任。您应避免使用制作、上传复制、发布传播或转载以下信息：</br>\n1)违反法律法规和社会公序良俗的信息；</br>\n2)危害国家安全和政治稳定的信息；</br>\n3)侵犯他人、企业的权利利益或不实信息；</br>\n4)不友善不真实的信息；</br>\n5)不尊重职者云招聘权利和扰乱服务的信息。</br>\n如出现任何违规行为，职者云有权依照我们的独立判断在未经事先通知的情况下予以屏蔽或删除。如您的行为已经涉嫌违反我国法律法规或侵犯到他人的民事权利，您应独立承担全部的法律责任，如您给平台造成的损失，或平台因您的行为而需承担的任何责任均可向您追责。</br>\n特别说明，您在社区发表的内容仅代表您的个人立场和观点，不代表职者云的立场和观点。也请注意不要添加陌生人微信、QQ等，自行判断相关内容、信息、行为的安全性，职者云不对用户因交友产生的损伤承担任何责任。</br>\n6、安全义务</br>\n职者云将采取技术措施和必要措施尽力保证网络安全、稳定运行，并防范网络违法犯罪活动。每位用户应遵守相关法律法规和平台更新的规范用户行为准则，不应从事行为包括且不限于：\n1)违反网络安全规定和危害计算机信息网络安全的活动；</br>\n2)使用职者云服务危害国家安全、破坏政治稳定、泄露国家机密，侵犯国家、社会、集体利益和第三方合法利益行为；</br>\n3)发布违反国家法律法规、破坏社会和谐、欺诈虚假、侵犯他人知识产权或其它违背社会公共利益的信息；</br>\n4)从事其它法律法规和职者云不定期更新的规范用户行为的活动。</br>\n如您的行为违反上述行为或有其他违反我国法律法规的行为，平台将配合相关部门提交您的信息及所有的平台操作及记录等，并且由您个人承担一切责任，如您给平台造成的损失，或平台因您的行为而需承担的任何责任均可向您追责。</br>\n五、职者云安全提示</br>\n职者云将对用人单位资历、招聘真实性严格管理，严禁用人单位做出任何损害求职者合法权益的违法违规行为，包括但不限于扣押求职者证件、收取求职者财物、向求职者集资等，您一旦发现此类行为，请立即举报。</br>\n六、不可抗力及免责声明</br>\n1、不可抗力</br>\n不可抗力指不能预见、不能避免及克服的事件，有可能对一方或双方造成重大影响的客观事件，包括且不限于地震、洪水等自然灾害，政府行为，传染病疫情，网络病毒，信息网络，法律法规变动等。如发生不可抗力情形，我们将尽全力及时修复，但由此给您造成的损失，我们将在法律允许的范围内免责。</br>\n2、其它免责事由</br>\n1)每位用户应审慎对待他方行为，职者云无法对企业和用户的线下行为负责，因他方在职者云平台之外的行为给用户造成任何不利影响的，您同意职者云免责；</br>\n2)职者云会严格把控平台企业的合法性和真实性，但由于互联网技术和人力受限，职者云无法对其平台信息、内容、产品和服务做任何形式的保证、声明或担保，您应在使用过程中审慎甄别和判断，并承担可能存在或导致的风险。职者云将承诺持续提升服务质量及水平，为您提供更加优质的服务。</br>',content2:"\n\n\n企业端用户服务协议</br>\n欢迎您注册并使用职者云账户及服务。</br>\n职者云一直以来视用户的信息安全与隐私保护为公司的生命线。我们已根据现行法律法规制定了职者云企业端用户服务政策，并且采取相应的安全保护措施来保护您的信息，对于重点内容，我们也已在协议中进行重点标注。请您仔细阅读。</br>\n温馨提示您注意：当您点击“同意”时，视为您已阅读并愿意接受《职者云企业端用户服务协议》的所有内容，当您点击“不同意”时，我们将无法为您提供完整的产品和服务。</br>\n一、本用户协议适用于职者云云平台、移动客户端等各关联平台或媒介的服务。</br>\n二、由于您的账号关联您的单位信息及平台商业信息，您的账号仅限本单位使用。为保护您的权益与个人信息，您不得出借、出租、转让账号，或者直接或间接授权任何第三方使用您账号或获取您账号信息。</br>\n三、账号注册与使用</br>\n1、职者云旨在搭建人才与雇主之间的“防火墙”，为帮助您高效筛选更优质人才，您应当秉承积极向上、诚实信用的原则，合法、真实、准确地填写您的信息。有您助力，我们共建风清气正的职场环境，推动实现用人有供。如果您所提供信息不合法、不真实、不准确或未及时更新，将有可能给您带来不利后果或相关法律责任。</br> \n2、为证明企业用户主体资格的真实性，请注册时提供上传相关证明材料（包括且不限于加盖公章的营业执照副本、员工社保缴纳证明、企业对使用者授权书等），请相信，更为完善的资质材料将帮助您吸纳更多的优质人才。您应该秉持诚实信用、合法合规的原则，提供真实、合法和准确的注册资料，避免任何违法或不良信息，相关资料如有变动，请及时更新。特别提醒，如果您提供信息不合法、不真实、不准确或未及时更新，有可能为雇员或创业创意提供者带来不利后果，职者云有权将不当信息予以下架乃至追究责任。</br>\n3、您应该承诺在注册时已年满18周岁，且具备相应的民事行为能力签订本用户协议。在注册成为企业用户的同时，您也承认了已获得企业用户充分授权，且授权您的企业及您本身拥有购买职者云服务产品所必须的完全民事权利和民事行为能力，接受本协议的约束。</br>\n4、请妥善管理您的用户名、登录密码、支付密码（如有），请不要轻信索要密码或财产的网络信息，不要将上述信息提供给任何第三方使用，不从事任何可能使用户名、密码存在泄露危险的行为。为保障您良好的职场记录，请务必对您账号下的所有行为结果（包括但不限于发布招聘信息、购买商品及服务及披露信息等）负责。</br>\n5、您企业名下的账号操作行为均视为企业行为，您需对您企业名下的账号承担管理责任。账户使用如存在不当注册或不当使用职者云账号的情形，我们可能对相关账号进行一定程度的限制使用、登录或采取其他合理措施（如暂时或永久封禁账号等）。</br>\n6、作为企业端用户，职者云将赋予企业专属账户，如果您从当前企业离职，您应当及时做好内部交接，并将相关管理权限交接给下一任工作负责人。若您在离职后仍以企业名义从事任何行为，给原企业或第三方造成任何损伤的，您应当承担赔偿责任，且您的个人行为与平台无关。</br>\n六、职者云服务及规范</br>\n1、服务概况</br>\n职者云致力于打造“可溯源”人力资源闭环开发体系，对接高社会值产业资源，构建人才、智果培育与供需数智化综合解决平台。职者云向用户提供的服务，包括且不限于求职招聘、创业孵化、职前教育、广告等产品和服务。平台会根据用户的需求不定期调整更新，具体请以云平台的展示服务项目为准。</br>\n2、服务行为</br>\n职者云用于人才求职、招聘、创业项目发布，您在成功注册企业用户后，即可在职者云平台发布招聘、项目需求等信息。您可通过线上/线下面试或交流的方式开展招聘/项目对接活动，通过面试、笔试、语言交流等方式，确认符合职位需求的求职者名单或公司需要的创新创业项目信息。特别提醒，您应当实施真实、合法、有效的招聘活动和项目对接活动，并避免出现任何违法或不恰当的行为，包括但不限于： </br>\n1)发布任何违反法律法规及互联网用户规范的信息或言论；</br>\n2)发布任何与招聘、项目需求对接无关或与不符合社会主义核心价值观的意见或信息；</br>\n3)发布虚假、不准确、不完整或具有误导性的职位信息、项目需求信息等内容；</br>\n4)以任何形式侵犯他人的著作权、商业秘密、知识产权或其它合法权益；</br>\n5)将我们的产品或服务用于非法目的或非法使用职者云产品服务的行为。</br>\n6)扣押被录用人员、面试人员或项目对接人员的居民身份证和其它证件，或以担保或其它任何名义向劳动者收取财物，牟取不正当利益等违法犯罪行为。</br>\n为提高您的招聘效率，职者云可能将职位、项目需求信息投放至第三方合作平台，您知悉并同意职者云将上述信息共享进行退广。我们将建立规范的职场成长实录制度并保障您的合法权益及良好体验，鉴于人力及互联网技术的有限性，我们无法逐一审查信息的真实性和准确性，您公开发布的信息可能被任何其他访问者浏览，也可能被错误使用，对此您应审慎判断。</br>\n3、平台使用</br>\n职者云平台为企业招聘、项目需求提供对接、孵化服务，特别提醒您在使用中不得存在以下行为：</br>\n1)将任何服务中的信息用于任何商业目的，未经我们的同意，向任何第三方披露、转让非公开信息或以类似方式使第三方知晓相关信息；</br>\n2)未经我们的同意，将从平台上获得的服务产品（包括且不限于简历、项目信息）用于任何除平台功能以外的其它目的，或以任何方式泄露、授权或变相授权给任何第三方；</br>\n3)擅自打印、复制或以其它方式泄露雇员、项目的任何资料；</br>\n完成招聘或项目对接服务后，您应将从平台上获取的服务产品或信息予以销毁，并且不得将上述内容用于除自身招聘以外的其它目的，或以任何方式泄露、授权或变相授权给任何第三方。\n4、反馈服务</br>\n您可通过“企业反馈”等功能对曾就职于贵单位的实习或就职人员做出评价，也可通过“雇主评价”功能获取就职人员对贵单位的反馈内容，共同推动职场环境的良好向善发展。\n5、智能服务</br>\n您理解并同意职者云平台通过智能匹配技术，为您更全面、更精准的匹配岗位服务或有关招聘、创业活动的专场活动信息，以更高效提升信息对接效率。限于互联网技术及人力的局限性，平台无法完全保证向您推送的信息均适配、完整、可靠，特别提醒您应审慎判断抉择。\n6、支付服务</br>\n您在购买我们的任何付费服务前，请仔细阅读付费服务的相关条款，涉及到第三方服务提供商提供的服务时，您需要阅读并同意第三方服务提供商的用户协议及产品规则。特别提醒：我们将根据不同的服务种类设定相应的价格机制，您购买服务产品的价格以网站公布的价格为准，请您确认无误再支付。\n7、社区服务</br>\n您可通过社区功能分享、传播及获取职场信息，如您使用社区服务，应遵守社区交流规范，对所发表的内容真实性和合法性负责并承担法律责任。您应避免使用制作、上传复制、发布传播或转载以下信息：</br>\n1)违反法律法规和社会公序良俗的信息；</br>\n2)危害国家安全和政治稳定的信息；</br>\n3)侵犯他人、企业的权利利益或不实信息；</br>\n4)不友善不真实的信息；</br>\n5)不尊重职者云招聘权利和扰乱服务的信息。</br>\n如出现任何违规行为，职者云有权依照我们的独立判断在未经事先通知的情况下予以屏蔽或删除。如您的行为已经涉嫌违反我国法律法规或侵犯到他人的民事权利，您应独立承担全部的法律责任，如您给平台造成的损失，或平台因您的行为而需承担的任何责任均可向您追责。</br>\n特别说明，您在社区发表的内容仅代表您的个人立场和观点，不代表职者云的立场和观点。也请注意不要添加陌生人微信、QQ等，自行判断相关内容、信息、行为的安全性，职者云不对用户因交友产生的损失损伤承担任何责任。</br>\n8、安全义务</br>\n职者云将采取技术措施和必要措施尽力保证网络安全、稳定运行，并防范网络违法犯罪活动。每位用户应遵守相关法律法规和平台更新的规范用户行为准则，不应从事行为包括且不限于：\n1)违反网络安全规定和危害计算机信息网络安全的活动；</br>\n2)使用职者云服务危害国家安全、破坏政治稳定、泄露国家机密，侵犯国家、社会、集体利益和第三方合法利益行为；</br>\n3)发布违反国家法律法规、破坏社会和谐、欺诈虚假、侵犯他人知识产权或其它违背社会公共利益的信息；</br>\n4)从事其它法律法规和职者云不定期更新的规范用户行为的活动。</br>\n如您的行为违反上述行为或有其他违反我国法律法规的行为，平台将配合相关部门提交您的信息及所有的平台操作及记录等，并且由您个人承担一切责任，如您给平台造成的损失，或平台因您的行为而需承担的任何责任均可向您追责。</br>\n七、责任承担</br>\n职者云有权对用户的产品/服务使用情况进行审查和监督，并对不当行为进行处理，用户有义务接受基于职者云平台的监督与管理，配合平台工作，共同促进职场环境的净化与提效。如职者云发现招聘/项目对接过程中的不当行为，有权提出警示，情节严重者可不经通知随时删除、屏蔽或断开链接。</br>\n职者云拥有平台开发、运营和维护云平台的各种源代码、执行程序等，受中国版权法律、法规保护。我们享有所有的知识产权和相关权益，不因您的任何使用行为发生任何的权利转移。未经职者云书面同意，任何人不得擅自使用、修改或模仿职者云产品/服务的衍生品，不得通过反向工程、反编译等类似行为获得职者云源代码等，否则，我们有权追究您的责任，要求您赔偿由此为我们或他人带来的损失，并有权视情况移交相关政府部门处理。</br>\n如您上传的内容存在侵权、您利用平台进行的行为侵犯到其他人的权利或已经触犯我国刑法或任何其他的权利瑕疵而引起权利纠纷的，您应当自行解决该纠纷并独立承担相应的责任，与平台无任何关系。</br>\n六、不可抗力及免责声明</br>\n1、不可抗力</br>\n不可抗力指不能预见、不能避免及克服的事件，有可能对一方或双方造成重大影响的客观事件，包括且不限于地震、洪水等自然灾害，政府行为，传染病疫情，网络病毒，信息网络，法律法规变动等。如发生不可抗力情形，我们将尽全力及时修复，但由此给您造成的损失，我们将在法律允许的范围内免责。\n2、其它免责事由</br>\n1)每位用户应审慎对待他方行为，职者云无法对企业和用户的线下行为负责，因他方平台外行为给用户造成任何不利影响的，您同意职者云免责；</br>\n2)职者云会严格把控平台企业的合法性和真实性，但限于互联网技术和人力受限，职者云无法对其平台信息、内容、产品和服务做任何形式的保证、声明或担保，您应在使用过程中审慎甄别和判断，并承担可能存在或导致的风险。职者云将承诺持续提升服务质量及水平，为您提供更加优质的服务。</br>\n3)为提供更智能化的产品/服务，提升用户体验，我们会定期/不定期对职者云软件进行更新，建议您将软件更新到最新版本，以保证最佳使用体验。 </div>"}}}},ff09:function(n,r,b){"use strict";var t=b("41a0"),e=b.n(t);e.a}},[["3f5f","common/runtime","common/vendor"]]]);